import React from "react";
import {Col, Row, Container} from "../Grid/Grid";
const Navbar = () => {

    return(
        <div className="Navbar">
            <Row>
            <div>
            <a href="/about">
                About
            </a>
            </div>
            <div>
            <a href="/contact">
                Contact
            </a>
            </div>
            <div>
            <a href="/portfolio">
            Portfolio
            </a>
            </div>
            </Row>
        </div>
    );

};

export default Navbar;
